export const CreatorCompars = () => {
    return (
        <>
            <div className="creator">
                <div className="creatorRow">
                    <div className="cardsPosition">

                        <Link to="/creator/comparsa/tino_tovar" ><CategoriesElements children="comparsa" image={<img src={randomComparsa} alt={"Comparsa"} width="350px" height="225px" object-fit="cover" />} /></Link>
                        <Link to="/creator/comparsa/kike_remolino" ><CategoriesElements children="chirigota" image={<img src={randomChirigota} alt="Chirigota" width="350px" height="225px" object-fit="cover" />} /></Link>
                        <Link to="/creator/comparsa/martinez_ares" ><CategoriesElements children="cuarteto" image={<img src={randomCuarteto} alt="Cuarteto" width="350px" height="225px" object-fit="cover" />} /></Link>
                        <Link to="/creator/comparsa/el_jona" ><CategoriesElements children="coro" image={<img src={randomCoro} alt="Coro" width="350px" height="225px" object-fit="cover" />} /></Link>

                    </div>
                </div>
            </div>
        </>
    );
}
